import React, { useState } from 'react'
import './Bike.css'
import axios from 'axios'
export const Bike = () => {
    const [bike, SetBike] = useState(
        {
            bikename: '',
            bikenumber: '',
            bikemodel: '',
            bikebrand: '',
            bikeyear: '',
            bikecolor: '',
            price: '',
            biketype: '',
            bikecondition: '',
            quantity: '',
            description: '',
            image: null
        }

    )
    const [message, setmessage] = useState('');

    const handleChange = (event) => {
        const { name, value, type, files } = event.target;
        if (type === 'file') {
            SetBike({ ...bike, [name]: files[0] });
        } else {
            SetBike({ ...bike, [name]: value })
        }

    }
    const handleSubmit = async (event) => {
        event.preventDefault();

        try {
            const response = await axios.post('http://localhost:9093/supplier/createSupplier', bike, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });
            if(response.ok){
                console.log(response.data)
            }
        } catch (error) {

        }

        setmessage("SuccessFully Upload...!");
        setTimeout(() => {
            setmessage('');
        }, 2000);
        SetBike(
            {
                bikename: '',
                bikenumber: '',
                bikemodel: '',
                bikebrand: '',
                price: '',
                bikeyear: '',
                bikecolor: '',
                biketype: '',
                bikecondition: '',
                quantity: '',
                description: '',
                image: null,
            }
        )
    }
    return (
        <div>
            <div className='bike-form-container'>
                <h2>Bike Information</h2>
                <div>
                    {message && (
                        <div className='message'>
                            {message}
                        </div>
                    )}
                </div>
                <form onSubmit={handleSubmit} className='bike-form'>
                    <div className='form-group'>
                        <label htmlFor='bikename'>Bike Name:</label>
                        <input
                            type='text'
                            id='bikename'
                            name='bikename'
                            value={bike.bikename}
                            onChange={handleChange}
                            required
                            aria-required='true'
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor='bikenumber'>Bike No:</label>
                        <input
                            type='text'
                            id='bikenumber'
                            name='bikenumber'
                            value={bike.bikenumber}
                            onChange={handleChange}
                            required
                            aria-required='true'
                        />
                    </div>

                    <div className='form-group'>
                        <label htmlFor='model'>Bike Model:</label>
                        <input
                            type='text'
                            id='model'
                            name='bikemodel'
                            value={bike.bikemodel}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className='form-group'>
                        <label htmlFor='brand'>Bike Brand:</label>
                        <input
                            type='text'
                            id='brand'
                            name='bikebrand'
                            value={bike.bikebrand}
                            onChange={handleChange}
                        />
                    </div>

                    <div className='form-group'>
                        <label htmlFor='bikeyear'>Year of Manufacture:</label>
                        <input
                            type='date'
                            id='bikeyear'
                            name='bikeyear'
                            value={bike.bikeyear}
                            onChange={handleChange}
                            min='1900'
                            max={new Date().getFullYear()}
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor='color'>Color:</label>
                        <input
                            type='text'
                            id='color'
                            name='bikecolor'
                            value={bike.bikecolor}
                            onChange={handleChange}
                        />
                    </div>

                    <div className='form-group'>
                        <label htmlFor='type'>Bike Type:</label>
                        <input
                            type='text'
                            id='type'
                            name='biketype'
                            value={bike.biketype}
                            onChange={handleChange}
                        />
                    </div>

                    <div className='form-group'>
                        <label htmlFor='condition'>Condition:</label>
                        <select
                            id='condition'
                            name='bikecondition'
                            value={bike.bikecondition}
                            onChange={handleChange}
                        >
                            <option value=''>Select Condition</option>
                            <option value='New'>New</option>
                            <option value='Like new'>Like new</option>
                            <option value='Good'>Good</option>
                            <option value='Fair'>Fair</option>
                            <option value='Poor'>Poor</option>
                        </select>
                    </div>

                    <div className='form-group'>
                        <label htmlFor='price'>Rental Price (per day):</label>
                        <input
                            type='number'
                            id='price'
                            name='price'
                            value={bike.price}
                            onChange={handleChange}
                            min='0'
                        />
                    </div>

                    <div className='form-group'>
                        <label htmlFor='quantity'>Quantity:</label>
                        <input
                            type='number'
                            id='quantity'
                            name='quantity'
                            value={bike.quantity}
                            onChange={handleChange}
                            required
                            aria-required='true'
                            min='1'
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor='image'>Uplaod Image:</label>
                        <input
                            type='file'
                            id='image'
                            name='image'

                            onChange={handleChange}
                            required

                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor='description'>Description:</label>
                        <textarea
                            id='description'
                            name='description'
                            value={bike.description}
                            onChange={handleChange}
                        />
                    </div>
                    <div >
                        <button className='bike-button' type='submit'>SUBMIT</button>
                    </div>

                </form>
            </div>

        </div>
    )
}
